import axios from 'axios';
import { apiEndpoint } from './apiConfig';

export async function getMove(board, player) {
  var move = -1;
  console.log("sending board: ", board);
  console.log("sending player: ", player);
    await axios.post(`${apiEndpoint}/getMove`, {
      headers: {
        board: board,
        player: player
      }
    }).then((response) => {
      move = response.data['move']
    })
    return move
}
